import logo from './logo.svg';
import './App.css';

import React, { useState } from 'react';

function Title() {
  const [isHovered, setIsHovered] = useState(false);

  const handleMouseEnter = () => {
    setIsHovered(true);
  };

  const handleMouseLeave = () => {
    setIsHovered(false);
  };

  const margin = isHovered ? 10 : 0;

  return(
    <div className="isolate titles">
      <a href="index.html" id="title" className="title rainbow blue">JackSavini.com</a>
      <a href="index.html" id="title" className="title rainbow green">JackSavini.com</a>
      <a
        href="index.html"
        id="title"
        className="title rainbow red"
        style={{ marginLeft: margin + 'px' }}
        onMouseEnter={handleMouseEnter}
        onMouseLeave={handleMouseLeave}
      >
        JackSavini.com
      </a>
    </div>
  )
}

function App() {
  return (
    <Title/>
  );
}

export default App;
